// DashboardTable.js
import React, { useState } from 'react';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  TextField,
  IconButton
} from '@mui/material';
import AddCircleOutlineIcon from '@mui/icons-material/AddCircleOutline';
import ActionBar from './ActionBar'; // Import ActionBar
import { getFileIcon } from './utils'; // Utility function to get the file icons, make sure this is correct
import '../styles/styles.css';

const DashboardTable = () => {
  const [students, setStudents] = useState([
    { name: 'Claire Johnson', submissions: [], grade: '', comments: '' }
  ]);

  // Handles new file submissions
  const handleNewSubmission = (newSubmission, index) => {
    const updatedStudents = [...students];
    updatedStudents[index].submissions = [
      ...updatedStudents[index].submissions,
      newSubmission
    ];
    setStudents(updatedStudents);
  };

  // Adds a new student row
  const addNewRow = () => {
    setStudents([...students, { name: '', submissions: [], grade: '', comments: '' }]);
  };

  return (
    <Paper>
      <TableContainer>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Name</TableCell>
              <TableCell colSpan={2}>Submission and Date</TableCell>
              <TableCell>Grade</TableCell>
              <TableCell>Comments</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {students.map((student, index) => (
              <TableRow key={index}>
                <TableCell>
                  <TextField
                    fullWidth
                    value={student.name}
                    onChange={(e) => {
                      const updatedStudents = [...students];
                      updatedStudents[index].name = e.target.value;
                      setStudents(updatedStudents);
                    }}
                    placeholder="Enter name"
                  />
                </TableCell>
                <TableCell colSpan={2}>
                  <div style={{ display: 'flex', flexDirection: 'column', gap: '8px' }}>
                    {student.submissions.map((submission, subIndex) => (
                      <div key={subIndex} style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
                        {getFileIcon(submission.fileName)}
                        <span>{submission.fileName}</span>
                        <span>{submission.submittedOn.toLocaleDateString()}</span>
                      </div>
                    ))}
                  </div>
                  <ActionBar 
                    onFileUpload={(event) => {
                      const file = event.target.files[0];
                      if (file) {
                        handleNewSubmission({
                          fileName: file.name,
                          submittedOn: new Date(),
                        }, index);
                      }
                      event.target.value = null; // reset the file input
                    }}
                  />
                </TableCell>
                <TableCell>
                  <TextField
                    fullWidth
                    value={student.grade}
                    onChange={(e) => {
                      const updatedStudents = [...students];
                      updatedStudents[index].grade = e.target.value;
                      setStudents(updatedStudents);
                    }}
                    placeholder="Enter grade"
                  />
                </TableCell>
                <TableCell>
                  <TextField
                    fullWidth
                    value={student.comments}
                    onChange={(e) => {
                      const updatedStudents = [...students];
                      updatedStudents[index].comments = e.target.value;
                      setStudents(updatedStudents);
                    }}
                    placeholder="Enter comments"
                  />
                </TableCell>
              </TableRow>
            ))}
            <TableRow>
              <TableCell colSpan={5} style={{ textAlign: 'center' }}>
                <IconButton onClick={addNewRow}>
                  <AddCircleOutlineIcon />
                </IconButton>
              </TableCell>
            </TableRow>
          </TableBody>
        </Table>
      </TableContainer>
    </Paper>
  );
};

export default DashboardTable;
